            <div className="title"><img src={vowel} className="image2" /><h2 className='word'>Fáwẹ̀lì</h2></div><br></br>
            <div className="title-content"><h5>Get started with learning Vowels in Yoruba<br></br>Lets GO!</h5></div>
        </div>
    )
}

